  _HOME_Y 
  G0 X89.5 Y89.5 F6000
  G28 Z
  CENTER

[gcode_macro HomeAll_Tilt]
gcode:
  _HOME_X
  _HOME_Y
  G0 X89.5 Y89.5 F6000
  G28 Z 
  CENTER
  Fast_Tilt

[gcode_macro CHOME]
description: Homes XYZ axis only if printer is in a non-homed state
gcode:
  {% if "xyz" not in printer.toolhead.homed_axes %}
    G28
  {% endif %}
    

[idle_timeout]
timeout: 1800

[z_tilt]

z_positions:
 -50, -13
  90, 217
  213, -13
points:
  15, 10
  89.5, 140
  168, 10

##--------------------------------------------------------------------

speed: 300
horizontal_move_z: 5
retries: 25
retry_tolerance: 0.005

[gcode_macro z_tilt_scan]
gcode:
  Z_Tilt_Adjust RETRY_TOLERANCE=1
  Z_Tilt_Adjust HORIZONTAL_MOVE_Z=2

[gcode_macro Fast_Tilt]
gcode:
    # Home first if needed
    {% if printer.toolhead.homed_axes != "xyz" %}
        G28
    {% endif %}
    Z_TILT_ADJUST horizontal_move_z=18 retry_tolerance=1.00
    Z_TILT_ADJUST horizontal_move_z=2
    G28 Z

########################################
# EXP1 / EXP2 (display) pins
########################################

[board_pins]
aliases:
    # EXP1 header
    EXP1_1=PE8, EXP1_2=PE7,
    EXP1_3=PE9, EXP1_4=PE10,
    EXP1_5=PE12, EXP1_6=PE13,    # Slot in the socket on this side
    EXP1_7=PE14, EXP1_8=PE15,
    EXP1_9=<GND>, EXP1_10=<5V>,

    # EXP2 header
    EXP2_1=PA6, EXP2_2=PA5,
    EXP2_3=PB1, EXP2_4=PA4,
    EXP2_5=PB2, EXP2_6=PA7,      # Slot in the socket on this side
    EXP2_7=PC15, EXP2_8=<RST>,
    EXP2_9=<GND>, EXP2_10=<5V>

